// state
const state = {
  items: []
}

// actions
const actions = {
  addItem({ commit }, item) {
    commit('addItem', item)
  },
  removeItem({ commit }, index) {
    commit('removeItem', index)
  },
  clearItems({ commit }) {
    commit('clearItems')
  },
  loading({ commit }) {
    setTimeout(() => {
      commit('clearItems', [
        { name: '张三', age: 24 },
        { name: '李四', age: 5 },
        { name: '王五', age: 42 },
        { name: '芦切', age: 44 },
      ])
    }, 2000)
  }
}

// mutations
const mutations = {
  addItem(state, item) {
    state.items.push(item)
  },
  removeItem(state, index) {
    state.items.splice(index, 1)
  },
  clearItems(state, item = []) {
    state.items = item
  },
}
export default {
  namespaced: true,
  state,
  actions,
  mutations
}

